package com.example.asm_java_nangcao1.Model;public class contact_phone_Model {    private String idUser;    private String nameUser;    private String numberPhone;    private String ngayTaoTaiKhoan;    private int trangThai;    private int quyen;    private int soDon;    private String colorText;    public contact_phone_Model(String idUser, String nameUser, String numberPhone, String ngayTaoTaiKhoan, int trangThai, int quyen, int soDon, String colorText) {        this.idUser = idUser;        this.nameUser = nameUser;        this.numberPhone = numberPhone;        this.ngayTaoTaiKhoan = ngayTaoTaiKhoan;        this.trangThai = trangThai;        this.quyen = quyen;        this.soDon = soDon;        this.colorText = colorText;    }    public String getIdUser() {        return idUser;    }    public void setIdUser(String idUser) {        this.idUser = idUser;    }    public String getNameUser() {        return nameUser;    }    public void setNameUser(String nameUser) {        this.nameUser = nameUser;    }    public String getNumberPhone() {        return numberPhone;    }    public void setNumberPhone(String numberPhone) {        this.numberPhone = numberPhone;    }    public String getNgayTaoTaiKhoan() {        return ngayTaoTaiKhoan;    }    public void setNgayTaoTaiKhoan(String ngayTaoTaiKhoan) {        this.ngayTaoTaiKhoan = ngayTaoTaiKhoan;    }    public int getTrangThai() {        return trangThai;    }    public void setTrangThai(int trangThai) {        this.trangThai = trangThai;    }    public int getQuyen() {        return quyen;    }    public void setQuyen(int quyen) {        this.quyen = quyen;    }    public int getSoDon() {        return soDon;    }    public void setSoDon(int soDon) {        this.soDon = soDon;    }    public String getColorText() {        return colorText;    }    public void setColorText(String colorText) {        this.colorText = colorText;    }}